Вся история обслуживания с 2014 года на АВТ Бавария Киев.
На дилерской гарантии:
- термостат основной, термостат AGR;
- трубопровод форсунок стеклоомывателя;
- ограничитель водительской дверки;
- все патрубки системы охлаждения двигателя;
- передний правый нижний поперечный рычаг подвески.
Машина ухоженная, последняя замена масла была на 354 тыс. км 10 января 2020 (в среднем замена каждые 6.5 - 10 тыс км). Все расходники и все з\ч ставились только оригинальные, и исключительно у дилера АВТ Бавария. Есть все Акты выполненных работ за последние 5.5 лет, после покупки автомобиля, то есть можно проследить всю историю обслуживания и ремонта автомобиля за все время пока авто в Украине.
Хранение на подземном проветриваемом и отапливаемом паркинге.
Из основных ремонтов за последние 5 лет (кроме описанного выше):
- замена АКБ;
- замена рулевой рейки;
- замена подвески (почти все рычаги, втулки стабилизаторов, сайлентблоки);
- тормоза по кругу (тормозов.диски, колодки, суппорты, скобы, датчики, армированные шланги, тормозов. жидкость, штуцеры, вакуумный усилитель, и т.п.);
- ступицы с подшипниками по кругу;
- подвесной подшипник и эластичная муфта кардана;
- замена масла в заднем редукторе;
- замена "ёжика" климат-контроля;
- замена парктроников;
- замена всех топливных шлангов по днищу кузова;
- замена проводки в крышке  багажника;
- замена вакуумных подвесок двигателя и АКПП;
- замена ПТФ;
- ремонт "бублика" и полная замена масла в АКПП (не на АВТ);
- ремонт обмотки генератора (не на АВТ);
- полная реставрация фар с заменой обоих линз на биксеноновые (со шторкой для дальнего света) и ламп на оригинальные (не АВТ);
Может что-то забыл указать, все есть в документах на машину.
Также установлен блютуз в заводскую аудиосистему с микрофоном для разговоров по телефону по hands-free.
Обмен не интересует.
В машине работает все, кроме заводской вебасты, которая просто сгнила и отремонтировать ее не удалось. Машина полностью в заводской комплектации, без колхозного тюнинга.

